import React from 'react';

class Api extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			domain: 'localhost',
			route: this.props.route
		}
	}
	render() {
		return (
			<div>coucou</div>
		)
	}
}

export default Api;
